import React from "react";
import "./App.css";
import Maps from "./Maps";
import AddressBox from "./AddressBox";

function App() {
  return (
    <div className="App">
      <div className="app-map">
        <Maps />
      </div>
      <div className="app-address-box">
        <AddressBox />
      </div>
    </div>
  );
}

export default App;
